import React, { useState, useContext } from 'react';
import { Container, Form, Button, Row, Col, Alert } from 'react-bootstrap';
import { AppContext } from '../App';

const FactoryPurchased = () => {
  const { factoryPurchases, setFactoryPurchases } = useContext(AppContext);
  const [formData, setFormData] = useState({
    factoryName: '',
    quantities: { 
      '8mm': '', '10mm': '', '12mm': '', '14mm': '', 
      '16mm': '', '20mm': '', '24mm': '', '32mm': '' 
    },
    date: new Date().toISOString().split('T')[0],
  });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleQuantityChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      quantities: { 
        ...formData.quantities, 
        [name]: value === '' ? '' : parseInt(value) || 0 
      },
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Filter out empty quantities and convert to numbers
    const filledQuantities = Object.fromEntries(
      Object.entries(formData.quantities)
        .filter(([k, v]) => v !== '' && v > 0)
        .map(([k, v]) => [k, parseInt(v)])
    );

    // Check if at least one quantity is filled
    if (Object.keys(filledQuantities).length === 0) {
      setMessage('❌ Please enter at least one quantity');
      setTimeout(() => setMessage(''), 3000);
      return;
    }

    if (!formData.factoryName.trim()) {
      setMessage('❌ Please enter factory name');
      setTimeout(() => setMessage(''), 3000);
      return;
    }
    
    const newFactoryPurchase = { 
      ...formData, 
      quantities: filledQuantities, 
      id: Date.now(),
      timestamp: new Date().toISOString()
    };
    
    setFactoryPurchases(prevPurchases => [...prevPurchases, newFactoryPurchase]);
    setMessage('✅ Factory Purchase Registered Successfully!');
    
    setTimeout(() => setMessage(''), 3000);
    
    // Reset form
    setFormData({
      factoryName: '',
      quantities: { 
        '8mm': '', '10mm': '', '12mm': '', '14mm': '', 
        '16mm': '', '20mm': '', '24mm': '', '32mm': '' 
      },
      date: new Date().toISOString().split('T')[0],
    });
  };

  return (
    <Container className="mt-5">
      <h2>Add Factory Purchase</h2>
      {message && (
        <Alert variant={message.includes('❌') ? 'danger' : 'success'}>
          {message}
        </Alert>
      )}
      
      <Form onSubmit={handleSubmit}>
        <Row className="mb-3">
          <Col md={8}>
            <Form.Group>
              <Form.Label>Factory Name *</Form.Label>
              <Form.Control 
                type="text" 
                name="factoryName" 
                value={formData.factoryName} 
                onChange={handleChange} 
                placeholder="Enter factory name"
                required 
              />
            </Form.Group>
          </Col>
          <Col md={4}>
            <Form.Group>
              <Form.Label>Date *</Form.Label>
              <Form.Control 
                type="date" 
                name="date" 
                value={formData.date} 
                onChange={handleChange} 
                required 
              />
            </Form.Group>
          </Col>
        </Row>

        <h5 className="mb-3">Enter Quantities (Leave blank for 0)</h5>
        <Row className="mb-3">
          {Object.keys(formData.quantities).map((size) => (
            <Col md={3} key={size}>
              <Form.Group>
                <Form.Label>{size}</Form.Label>
                <Form.Control 
                  type="number" 
                  name={size} 
                  value={formData.quantities[size]} 
                  onChange={handleQuantityChange} 
                  min="0"
                  placeholder="0"
                />
              </Form.Group>
            </Col>
          ))}
        </Row>
        
        <Button variant="primary" type="submit" size="lg">
          Add Factory Purchase
        </Button>
      </Form>
    </Container>
  );
};

export default FactoryPurchased;
